import React from 'react';
import BrainFlixLogo from '../../assets/images/logos/BrainFlix-logo.svg';
import avatar from '../../assets/images/Mohan-muruge.jpg';
import './header-section.scss';
import HeaderLogo from './HeaderLogo';

function Header() {
    return (
        <section>
            <HeaderLogo />
            <div className="header-form padding">
                <form id="header-form__search">
                    <div className="header-form__search-container">
                        <div class="form-field">
                            <input type="text" name="header_search" id="search" placeholder="Search" />
                        </div>
                        <img src={avatar} className="header-form__avatar" />
                    </div>
                    <button type="submit">UPLOAD</button>
                </form>
            </div>
        </section>
    )
}

export default Header
